//  批量执行
class BatchExecution_BatchExecution {
  //  构造函数
  constructor() {
    this.has = {};
    this.queue = [];
    this.nextTick = nextTick(this.flush, this);
  }

  //  添加任务
  push(name, fn) {
    if (this.has[name]) {
      return;
    }
    this.has[name] = true;
    this.queue.push({
      name,
      fn
    });
    this.nextTick();
  }

  //   执行队列
  flush() {
    let fns = this.queue.slice(0);
    this.queue = [];
    fns.forEach(({
      name,
      fn
    }) => {
      this.has[name] = false;
      fn();
    });
  }
}
